import Vue from 'vue';
import Router from 'vue-router';
import HelloContainer from "./components/HelloWorld.vue";
import Exam01 from "./components/Exam01.vue";
import ExamMessageBox02 from "./components/ExamMessageBox02";
import ExamField03 from "./components/ExamField03";
import Login from "./components/Login";
Vue.use(Router);
export default new Router({
  routes: [{
    path: '/',
    component: HelloContainer
  }, {
    path: '/Exam01',
    component: Exam01
  }, {
    path: '/ExamMessageBox02',
    component: ExamMessageBox02
  }, {
    path: '/ExamField03',
    component: ExamField03
  }, {
    path: "/Login"
  }]
});
